import classes from "./Certification.module.css";

const Certification = () => {
  return (
    <div className={classes.certificate}>
      <h2>Certification</h2>
      <div className={classes.first}>
        <div className={classes.second}>
          <h2>React - The Complete Guide</h2>
          <h3></h3>
        </div>
      </div>
    </div>
  );
};

export default Certification;
